  return (
    <div class="main-profile-wrapper">
      <div class="main-profile-header"></div>
      <div class="main-profile-content">
        <thead>1</thead>
        <tbody>2</tbody>
        <tfoot>3</tfoot>
      </div>
    </div>
  );
};

export default Profile;
